var TOC_EXPAND=!0,TOC_SHRINK=!TOC_EXPAND,TOC_LOCK=!0,TOC_UNLOCK=!TOC_LOCK;function TOC(t){this.state=TOC_EXPAND,this.lock=TOC_UNLOCK;const s=document.getElementById(t);this.tocList=s.getElementsByClassName("toc").item(0),this.tocToggle=s.getElementsByClassName("toc-toggle").item(0),this.tocCaret=s.getElementsByClassName("toc-caret").item(0)}TOC.prototype.init=function(){var t=this;this.tocToggle.addEventListener("click",function(){t.toggle()})},TOC.prototype.getLock=function(){this.lock!==TOC_LOCK&&(this.lock=TOC_LOCK)},TOC.prototype.releaseLock=function(){this.lock=TOC_UNLOCK},TOC.prototype.toggle=function(){this.getLock(),this.state===TOC_EXPAND?(this.tocList.classList.add("shrink"),this.tocCaret.classList.add("down"),this.state=TOC_SHRINK):(this.tocList.classList.remove("shrink"),this.tocCaret.classList.remove("down"),this.state=TOC_EXPAND),this.releaseLock()};var toc=new TOC("toc");toc.init();